script: |
  super -f text -I q9873.spq | sort > q9873.out

inputs:
  - name: q9873.spq
    data: |
      SELECT - col0 FROM tab2 (FORMAT parquet) WHERE ( NULL ) BETWEEN NULL AND + col2 + col0 AND 95 - + col2 + col2 * + col2 * + 26 / col2 NOT IN ( - col1, - col0 );
  - name: tab2

outputs:
  - name: q9873.out
    data: |
